import React from 'react';
import { StyleSheet, Text, View, SafeAreaView } from 'react-native';
import { Input, Card } from 'react-native-elements';

export default function PetientPage(props) {

  const claculateAge = (birthdate) => {
    var birthDate = new Date(birthdate);
    var difference = Date.now() - birthDate.getTime(); 
    var ageDate = new Date(difference); 
    console.log(ageDate)
    alert(birthdate)
    return JSON.stringify(ageDate)/* `${Math.abs(ageDate.getUTCFullYear() - 1970)}`; */
  };
  
    return (
      <View style={styles.container}>
        <Text style={styles.title}>Prtient</Text>

        <Card>
          <Input
          label="Name"
          value={props.patient.first_name + " " + props.patient.last_name}
          disabled
          />
          <Input
          label="ID"
          value={props.patient.id}
          disabled
          />
          <Input
          label="Age"
          value={claculateAge(props.patient.birth_date)}
          disabled
          />
          <Input
          label="Contact name"
          value={props.patient.contact_name}
          disabled
          />
          <Input
          label="Contact phone"
          value={props.patient.contact_phone_number}
          disabled
          />
          <Input
          label="Arrival date"
          value={new Date(props.patient.reception_date).toLocaleDateString()}
          disabled
          />
        </Card>

        <Input
        label="Arrival date"
        value={JSON.stringify(new Date(props.patient.reception_date).toLocaleDateString())}
        disabled
        />
      </View>
    );
  }
  
  const styles = StyleSheet.create({
    container: {
      backgroundColor: '#ffffff',
      justifyContent: 'center',
    },
    title: {
      color: '#000000',
      fontSize: 20,
      marginBottom: 10,
      paddingHorizontal: 10,
    },
  });
